var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro app bar test object.
 * @param {Object} [props] Initializes a UIAPro App Bar test object using the supplied property bag.
 * @returns {AppBar} the description object that was initialized.
 * @class AppBar
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function AppBar(props) {
    var appBarDesc = new UiObjectBaseDescription("AppBar");

    appBarDesc._defineByPropertyBag(props);
    return appBarDesc;
}

/**
 * A UIAPro app bar.
 * @constructor
 * @class AppBarTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function AppBarTO(session, description) {
    description = description || AppBar();
    var appBarTO = new UiObjectBaseTO("UIAProAppBar", session, description);

    return appBarTO;
}

module.exports.AppBarTO = AppBarTO;
module.exports.AppBar = AppBar;